import { createBottomTabNavigator } from "@react-navigation/bottom-tabs";
import React from "react";
import HomeScreen from "../tabScreem/HomeScreen";
import SubsidiaryScreen from "../tabScreem/SubsidiaryScreen";
import { Octicons } from "@expo/vector-icons";
import CredentialScreen from "../tabScreem/CredentialScreen";
import MenuScreen from "../tabScreem/MenuScreen";
import { ImageBackground } from "react-native-web";

const Tab = createBottomTabNavigator();

const TabNavigation = () => {
  return (
    <Tab.Navigator
      initialRouteName="Home"
      screenOptions={{
        tabBarActiveTintColor: "purple",
        tabBarStyle: { backgroundColor: "#015cb5" },
        tabBarActiveBackgroundColor: "#013161",
        // tabBarShowLabel: false,
      }}
    >
      <Tab.Screen
        name="Home"
        component={HomeScreen}
        options={{
          headerShown: false,
          headerTitle: "Inicio",
          tabBarIcon: () => {
            return <Octicons name="home" size={30} color="#fff" />;
          },
        }}
      />
      <Tab.Screen
        name="Subsidiary"
        component={SubsidiaryScreen}
        options={{
          headerTitle: "Sucursales",

          tabBarIcon: () => {
            return <Octicons name="location" size={30} color="#fff" />;
          },
        }}
      />
      <Tab.Screen
        name="Credential"
        component={CredentialScreen}
        options={{
          headerTitle: "Credenciales",

          tabBarIcon: () => {
            return <Octicons name="id-badge" size={30} color="#fff" />;
          },
        }}
      />
      <Tab.Screen
        name="Menu"
        component={MenuScreen}
        options={{
          headerTitle: "Menu",
          tabBarIcon: () => {
            return <Octicons name="apps" size={30} color="#fff" />;
          },
        }}
      />
    </Tab.Navigator>
  );
};

export default TabNavigation;
